tables.table_schema:
CREATE TABLE influencer_tracking (
    influencer_id INT PRIMARY KEY,
    post_id INT,
    user_interactions INT,
    conversions INT
);

CREATE TABLE Influencers (
    influencer_id INT PRIMARY KEY,
    influencer_name VARCHAR(255),
    followers_count INT
);

CREATE TABLE influencer (
  influencer_id INT PRIMARY KEY,
  influencer_name VARCHAR(255) NOT NULL
);

CREATE TABLE conversion (
  conversion_id INT PRIMARY KEY,
  user_id INT,
  conversion_date DATE,
  FOREIGN KEY (user_id) REFERENCES user_interaction(user_id)
);

CREATE TABLE influencer ( 
    influencer_id INT PRIMARY KEY, 
    name VARCHAR(255) NOT NULL, 
    followers INT NOT NULL 
);

CREATE TABLE post ( 
    post_id INT PRIMARY KEY, 
    influencer_id INT NOT NULL, 
    content TEXT NOT NULL, 
    post_date DATE NOT NULL 
);

CREATE TABLE user_interaction ( 
    interaction_id INT PRIMARY KEY, 
    post_id INT NOT NULL, 
    user_id INT NOT NULL, 
    interaction_type VARCHAR(50) NOT NULL 
);

CREATE TABLE conversion ( 
    conversion_id INT PRIMARY KEY, 
    user_id INT NOT NULL, 
    conversion_date DATE NOT NULL, 
    conversion_amount DECIMAL(10, 2) NOT NULL 
);

CREATE TABLE influencer_stats ( 
    influencer_id INT PRIMARY KEY, 
    total_posts INT NOT NULL, 
    total_interactions INT NOT NULL, 
    total_conversions INT NOT NULL 
);
